import React , {useState , useEffect} from 'react'
import {GoogleLogin , GoogleLogout} from 'react-google-login';
import Search from './Search';
import {link} from "react-router-dom";

function HomePage() {

    const clientId = "773551022599-1375l2n31u4cclt9vi5r1mmspl5nt6fa.apps.googleusercontent.com";

    const [login , setLogin] = useState(true);

    const loginSuccessfully = (some) => {
        console.log("loginSuccessfully "+ some);
        setLogin(false);
        return (
            <link></link>
        )
    }
    const logoutSuccessfully = (some) => {
        console.log("logout successfully " + some);
        setLogin(true);
    }

    const failed = (some) => {
        console.log(some);
    }

    return (
        <div className=''>
            {

                login ? 

                <GoogleLogin

                    clientId={clientId}
                    buttonText="Login"
                    onSuccess={loginSuccessfully}
                    onFailure={failed}
                    cookiePolicy={'single_host_origin'}
                    isSignedIn={true}
                /> : 
                <GoogleLogout 
                
                clientId={clientId}
                buttonText="Logout"
                onLogoutSuccess={logoutSuccessfully}

                />
            }
        </div>
    )
}

export default HomePage
